import React from 'react';

export default class Sli extends React.Component {
      render(){
        return (
          <React.Fragment>
            <div className="glide">
                <div data-glide-el="track" className="glide__track">
                  <ul className="glide__slides">
                    <li className="glide__slide"></li>
                    <li className="glide__slide"></li>
                    <li className="glide__slide"></li>
                  </ul>
                </div>
              </div>
          </React.Fragment>
        )
      }

}
